import React, {useState, useEffect} from 'react';
import {Scatter} from 'react-chartjs-2';


const Graph1 = () => {
   const[chartdata, setchartdata] = useState({});

   const chart = () => {
    setchartdata({
      labels:'Volume',
      datasets: [
        {
          label:'VOL',
          data: [{x:2, y:4 }, {x:5, y:9 }, {x:6, y:2 }, {x:7, y:2 }],
          backgroundColor: '#4DBC19'
        },
        {
          label:'VOL',
          data: [{x:2, y:4 }, {x:5, y:9 }, {x:6, y:2 }, {x:7, y:2 }],
          backgroundColor: '#4DBC19'
        }
      ]
    })
   }

   useEffect(() => {
     chart();
   },[]);

   return (
    <div>
      <Graph1 data={chartdata} height={300} width={600} options={{ maintainAspectRatio: false }} />
    </div>
   )

}; 

export default Graph1;
